import React from 'react';
import './Listagem.css';

const Listagem = ({ simulacoes }) => {
  // Verificar se simulacoes é uma array
  if (!Array.isArray(simulacoes)) {
    // Pode ser exibida uma mensagem ou componente de fallback caso não seja uma array
    return <p>Não há simulações disponíveis.</p>;
  }

  return (
    <div>
      <h2>Listagem de Simulações</h2>
      {simulacoes?.length > 0 ? ( // Verificar se há simulacoes para exibir
        <table className="listagem-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Nome</th>
              <th>Email</th>
              <th>Telefone</th>
              <th>Código da Unidade</th>
              <th>Modelo Fásico</th>
              <th>Enquadramento</th>
              <th>Histórico de Consumo em kWh</th>
            </tr>
          </thead>
          <tbody>
            {simulacoes?.map((simulacao) => (
              <tr key={simulacao.id}>
                <td>{simulacao.id}</td>
                <td>{simulacao.nomeCompleto}</td>
                <td>{simulacao.email}</td>
                <td>{simulacao.telefone}</td>
                <td>{simulacao.unidades?.[0]?.codigoDaUnidadeConsumidora || 'N/A'}</td>
                <td>{simulacao.unidades?.[0]?.modeloFasico || 'N/A'}</td>
                <td>{simulacao.unidades?.[0]?.enquadramento || 'N/A'}</td>
                <td>
                  {simulacao.unidades?.[0]?.historicoDeConsumoEmKWH?.[0]?.consumoForaPontaEmKWH || 'N/A'}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>Não há simulações disponíveis.</p>
      )}
    </div>
  );
};

export default Listagem;
